import React from 'react';
import '../styles/Header.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import CreateGamePage from '../pages/CreateGamePage.js';

function Header() {
  return (
    <Router>
    <div id="header">
      <div className="header-left"> {/* 왼쪽에 배치할 div */}
        <h2>⚖️BALANCETALK</h2>
      </div>
      <div className="header-right"> {/* 오른쪽에 배치할 div */}
        <button id="new">+NEW</button>
        <Link id="new" to="/new">+NEW</Link>
        <button className="login-buttons">Login</button>
        <button className="register-buttons">Register</button>
      </div>
    </div>
    </Router>
  )
}

export default Header;
